import './Navbar.css';
import { FaDollarSign, FaShoppingCart, icons } from "react-icons/fa";
import {Link} from "react-router-dom";

function Navbar() {
  
  return (

    <div className="topnav" id="Tnav">
         <nav className='items'>
          <div className='link'>
            <Link to='/'>Women</Link>
          </div>
          <div className='link'>
            <Link to='/'>Men</Link>
          </div>
          <div className='link'>
            <Link to='/'>Kids</Link>
          </div>
         </nav>
         <span className='Fad'>
            <FaDollarSign />
            <FaShoppingCart />
         </span>
    </div>

  );
}

export default Navbar;
